INSERT INTO `madeleine` (`id`, `libelle`, `image`) VALUES
(20, 'Une de mes élèves m\'a offert aujourd\'hui un collier de perles multicolores.   Ne portant pas de bijoux, j\'en ai fait une madeleine.  Théorème de la journée :  Etre amoureux c\'est être en bonne santé. ', 'madeleine20.jpg'),
(21, 'J\'ai acheté d\'occasion du matériel de dentiste et notamment, une pince tout à fait remarquable.   C\'est grâce à elle d\'ailleurs, que j\'ai pu trier grain après grain, le sable de cette madeleine.  Pendant les 165 minutes, qu\'a duré le tri, j\'ai appris à vivre et connaître la nature du chemin. ', 'madeleine21.jpg'),
(22, 'Pendant plusieurs jours, un chiffon rouge a traîné à l\'atelier. Impossible de savoir d\'où il venait et comment il était arrivé là.  Mais à chaque fois que mon ombre venait  affleurer l\'invisible de sa peau , j\'avais l\'impression de rompre sa solitude.  J\'ai donc décidé d\'arrêter son calvaire. ', 'madeleine22.jpg'),
(23, 'Ce soir, les enfants m\'on demandé de leur faire un scoubidou mais impossible de me rappeler comment faire un scoubidou.  Pour ne pas avouer mon échec je leur propose une madeleine car ça je n\'ai pas oublié mais ils refusent catégoriquement, en me rétorquant :   ?  On en a plein la maison ?.  C\'est vrai mais je l\'ai quand même faite.  C\'est curieux, les choses se font en moi même quand je ne fais rien. ', 'madeleine23.jpg'),
(24, 'Des noyaux.   C\'est en récoltant les premières mirabelles du jardin que je me suis aperçu qu\'il était peut-être bon de ne jamais mûrir et donc difficile de pourrir.  La vie est vraiment un fruit autorisé. ', 'madeleine24.jpg'),
(25, 'Je ne sais pas ce que c\'est, mais quand je l\'ai trouvé, j\'ai pensé à Flaubert, qui disait : ? Tout est intéressant, pourvu qu\'on le regarde assez longtemps.?', 'madeleine25.jpg'),
(26, 'J\'ai passé cette journée, les mains dans le plâtre, où j\'y ai gommé minutieusement, tous les traits pour qu\'ils disparaissent dans une immobilité blanche.   Et c\'est là que c\'est produit un petit miracle mais tout petit, une seule trace dans mes mains émergea de cette blancheur profonde : ma ligne de vie.  Je me suis lavé les mains rapidement et me suis empressé de noter sur mon carnet : Vole-t-on sa vie quand elle ne nous a pas été donnée ? ', 'madeleine26.jpg'),
(27, 'Qui dit ampoule, dit idée. Et la bonne idée, c\'est de se poser la bonne question.   Alors la mienne se serait : Le je est-il  à tout le monde ou suis-je seulement moi-même ? ', 'madeleine27.jpg'),
(28, 'C\'est en jouant aux petits soldats avec Léo que je me suis demandé si l\'on pouvait croire à l\'intelligence humaine ?   Avant même que je trouve un semblant de réponse, Léo me dit :   ?  Tiens papa, une éponge pour effacer la colère. ', 'madeleine28.jpg'),
(29, 'Ce matin là, l\'atelier était un vrai frigo.   Heureusement un thé chaud entra dans mon corps comme un danseur qui lutte et qui vous soulage d\'un combat. ', 'madeleine29.jpg'),
(30, 'Ce sont des bougies d\'anniversaire bleues Bleues parce que c\'est un triste anniversaire, celui de Big blue, qui a battu Kasparov.  Mais ce qui me réjouis quand même, dans cette histoire, c\'est que la machine Big blue n\'a pas su, qu\'elle avait gagné. ', 'madeleine30.jpg'),
(31, 'Cette magnifique pierre rapportée de Yougoslavie éclaire mes ténèbres Intérieures.  Et ces ténèbres, auront beau carboniser ma vie, il m\'en restera toujours assez pour en savourer la lumière. ', 'madeleine31.jpg'),
(32, 'J\'ai passé une grande partie de la journée à l\'atelier pour essayer de trouver la couleur de l\'aube.            Celle qui remonte toutes les couleurs et qui vous fait débuter dans l\'innocence.            Impossible, même pas un reflet. Tout ce que j\'ai réussi à faire, c\'est de me schooter à l\'essence de térébenthine, l\'essence                  même du peintre.            Celle qui vous transporte au-delà des hormones.', 'madeleine32.jpg'),
(33, 'C\'est à cet instant précis, au milieu de mon émission préférée, que ma petite radio m\'a lâché.   C\'est donc à cet instant, où le présent veut sans cesse échapper à une mort probable, que j\'ai décidé, moi aussi, de la lâcher.  Clac ! fit la radio en tombant sur le lino. et pour le coup, silence radio.  J\'ai récolté les morceaux et une madeleine.   ', 'madeleine33.jpg'),
(34, 'Les aiguilles de sapin.  Plus je marchais et plus je les sentais dans mes chaussures de randonnée.   Mais elles finirent par ne faire plus qu\'une seule aiguille sous mon pied, et à faire savoir à mon cerveau pourquoi je marchais. ', 'madeleine34.jpg'),
(35, 'Voici quelques anches, qui proviennent de mon premier saxophone.   Ces anches sont pour moi comme des langues, des langues qui pourraient traduire, le mot être dans toutes les langues.  Quand ma langue touche ces langues, elle ne veut plus expliquer le monde mais essayer de l\'aimer. ', 'madeleine35.jpg'),
(36, 'Bien qu\'aujourd\'hui soit une longueur de fil dans la bobine de la vie, je m\'efforce de ne pas être là où je m\'y attend mais plutôt là où il faudrait que j\'aille.  J\'ai donc retourné mes poches, pour mieux entendre ces drôles d\'oreilles afin de leur tirer les coutures. ', 'madeleine36.jpg'),
(41, 'Je suis un spécialiste des exercices stupides. Ceux qui vous apprennent à vivre et vous situent avant le langage. Donc celui –ci, consistait à déchirer au hasard, une page de l\'annuaire, et d\'en faire une madeleine.  Ensuite, cette madeleine m\'a révélé un nom, le seul que je pouvais lire en entier : Mademoiselle Jade.  J\'ai ensuite téléphoné à Mademoiselle Jade et une charmante voix m\'a répondu : « Le numéro que vous venez de composer n\'est plus attribué, veuillez consulter l\'annuaire. » ', 'madeleine41.jpg'),
(37, 'Cette brosse à dent, que j\'ai repêchée dans la poubelle de la salle de bain, m\'a fait penser à un autre type d\'hygiène quotidienne.   Celle qui consiste, à s\'examiner, sur ses propres actions, comme :.  Essaye-t-on de se parfaire pour soi ou pour les autres ?  ', 'madeleine37.jpg'),
(38, 'Cette après-midi, j\'ai fait rentrer la lumière, dans ma petite forêt de bambou.  En les taillant, je me suis demandé s\'il était plus facile d\'écouter les végétaux ou les gens ?  ', 'madeleine38.jpg'),
(39, 'C\'est un cadran de baromètre, cette drôle permanence du temps, qui est muni d\'une flèche pouvant assujettir un lieu hors de portée.  Cette flèche me rappelle qu\'à la croisée des chemins, on tourne les fous pour qu\'ils retrouvent la bonne direction. ', 'madeleine39.jpg'),
(40, 'Cette madeleine n\'est pas l\'ombre de la nuit mais plutôt, l\'ombre intime d\'un amour qui est devenu le filtre de l\'éternel car il                s\'agit de la radiographie d\'un cœur.', 'madeleine40.jpg'),
(42, 'Quand je vois ce métal qui devient vert en vieillissant, je me dis que l\'inconscient n\'a pas d\'âge et que l\'on peut donc naître vieux et mourir jeune.', 'madeleine42.jpg'),
(43, 'C\'est de la sanguine, celle qui habille le nu.  Moi, justement, j\'ai tenté toute la soirée de déshabiller le nu, pour y trouver cet instantané de vérité.  Quand j\'ai eu confirmation, je me suis empressé de recouvrir cette vérité que j\'ignore d\'ailleurs, d\'une peau de peinture qui avait été préalablement élevée à l\'atelier, avec patience, délicatesse et sensualité. ', 'madeleine43.jpg'),
(44, 'C\'était la fin de l\'été et les cartes postales reçues durant juillet et août, avaient formé une montagne comme un continent, sorti de son pli.   Plutôt, que de les mettre à la poubelle, je les ai déposé comme une collection toujours incomplète dans le moule à madeleine.  Leurs strates, comme un levier à histoires, étaient devenues un présent absent mais partagé. ', 'madeleine44.jpg'),
(45, 'Voici du sable, qui provient de ma dune, celle que j\'arpente comme un sablier, partiellement perçu.  J\'y ai décidé de ne jamais m\'arrêter de marcher afin de ne pas tomber. ', 'madeleine45.jpg'),
(46, 'L\'Irlande.  Ce sont des algues flottantes, que j\'ai ramassées sur la plage et qui ont sans doute parfumées des sirènes,celles qui me parlent parfois dans la nudité de l\'origine.  Finalement, quand je regarde cette madeleine, j\'y vois aussi l\'océan sans limites. Il est aussi, comme ma madeleine, cerné de vagues. ', 'madeleine46.jpg'),
(47, 'Un morceau de mon antenne de télévision, que j\'ai pris sur le faîte.  Ma sucrerie oculaire étant devenue muette, suite à la tempête de 99, je n\'ai donc pas hésité une seconde à lui faire une petite biopsie maison pour cette madeleine. ', 'madeleine47.jpg'),
(48, 'Les coquilles d\'œufs  Après une nuit épuisante, je me suis enfin libéré de mon cauchemar.  J\'avais rêvé toute la nuit que je tondais un œuf. ', 'madeleine48.jpg'),
(49, 'Un chemin de terre est comme une couche nuptiale.  C\'est à cet endroit que j\'ai trouvé ces deux petits morceaux de tissu.  Et il m\'a plu d\'imaginer que l\'un provenait d\'un fauteuil d\'artiste et l\'autre d\'un divan de psychanalyste.  Il m\'a plu aussi, de leur passer la camisole de latex, qu\'est mon moule à madeleine. ', 'madeleine49.jpg'),
(50, 'C\'est dans cette incontournable épreuve du réel, les bras en l\'air toute la journée, à clouer du lambris au plafond que j\'ai enfin, pu me soulager en créant cette madeleine, image d\'une addition de petites souffrances.', 'madeleine50.jpg'),
(51, 'Mes petits crayons de papier.  C\'est vraiment magique un crayon de papier. Cela écrit n\'importe quoi et n\'importe comment.  Il faudrait  vraiment, que je fasse attention car j\'aurais tendance à en abuser. ', 'madeleine51.jpg'),
(52, 'L\'histoire fantastique du NE PAS.  Tout a commencé cette après-midi, où j\'ai trouvé un minuscule bout de papier déchiré, où l\'on pouvait lire que deux mots : NE PAS. Je me suis aussitôt remémoré cette anecdote. A la mort de son père, qui était imprimeur, le fils trouva dans la maison, une enveloppe assez grande et épaisse, avec noté dessus en lettres manuscrites ? Ne pas ouvrir.?.  Pendant cinq ans, rongé par la curiosité, le fils n\'ouvrira pas cette enveloppe. Puis, ne pouvant plus résister, il ouvrit enfin l\'enveloppe et y découvrit une pile de petites cartes, bien découpées, sur lesquelles étaient imprimées  les mots : NE PAS OUVRIR.  Le fils, venait simplement de découvrir une banale commande qu\'un client avait faite à son père quelques jours avant sa mort.   C\'est le genre d\'histoire, qui vous fait retomber dans l\'infini. ', 'madeleine52.jpg'),
(53, 'Les plumes du «  Capitaine Georges »  Cette pauvre perruche en avait déjà pris pour perpette derrière ses barreaux, mais maintenant, je l\'ai carrément  momifiée dans cette madeleine.  C\'est curieux parce que la forme de la madeleine me fait penser à une plume.  Celle qui orne les porte-plume, ceux qui sont toujours encrés, comme les perruches d\'ailleurs. ', 'madeleine53.jpg'),
(54, 'Mes lacets de chaussures.  Ce matin, il y en a un, qui m\'est resté dans les mains, trop vieux. C\'était un lacet qui avait trop mesuré le temps.   Moi aussi je vieillis pour savoir qui j\'ai été et j\'espère également claquer un jour comme mon lacet. ', 'madeleine54.jpg'),
(55, 'Mon dictionnaire a rendu l\'âme. Impossible de scotcher le scotch du scotch.  Bien qu\'il soit complètement écartelé, il ne me tend plus les bras.  Plus d\'enquête à mener avec lui, où j\'ouvrais le monde pour y trouver ce que je ne cherchais pas.  Adieu, cœur portatif. Nous nous retrouverons un jour, transporté par les alluvions. ', 'madeleine55.jpg'),
(56, 'C\'est de la OUATE.  Une amie qui travaille beaucoup avec ce matériau, me l\'a donné après une exposition qu\'on avait faite ensemble.  Il y a vraiment une attirance de peau à peau avec cette madeleine.   Quand je l\'effleure je sens ce petit nuage, dont les poumons ont respiré trop fort l\'éther. ', 'madeleine56.jpg'),
(57, 'Ce sont des aiguilles de pendule, que j\'ai trouvé dans leur boîte à disparition.   Symbole de la mobilité, de l\'éternité, je les ai collé ensemble pour que leur durée s\'étalent, entre le déjà et le pas encore.  Quand j\'ai eu terminé cette madeleine, j\'ai fait spontanément une définition pour mon encyclopédie.  Horloge : Qui vit dans une cage, par crainte du chaos. ', 'madeleine57.jpg'),
(58, 'Cette matière n\'est autre que le masque, que je portais à l\'hôpital, lors de la césarienne pour la naissance d\'Arthur.  Plein de sa vision intérieure, Arthur m\'a regardé.  Deux bouches bleues venaient d\'avaler le monde ', 'madeleine58.jpg'),
(59, 'Un morceau de guirlande de Noël.  Supposons que le père noël, ne soit pas un homme, mais une femme ou mieux encore une sage-femme.  Donc les bébés sont des cadeaux et passent par la cheminée.  En conséquence, la cheminée n\'est pas une lunette à ciel, mais la métaphore du col de l\'utérus. ', 'madeleine59.jpg'),
(19, 'C\'était un jour de pluie dans la forêt de la Wantzenau, je m\'en souviens très bien. Enfin ce sont plutôt mes épaules qui s\'en souviennent.  Je portais Antoine sur mes épaules parce que ses bottes étaient percées.  A cet instant, l\'odeur du caoutchouc a rallumé la lumière de l\'enfant qui s\'était assoupi en moi.   La vie n\'a donc pas cessé d\'être un songe. ', 'madeleine19.jpg'),
(8, 'Cette madeleine est une relique.   Quand j\'étais étudiant aux Beaux Arts j\'avais une chemise couverte de plusieurs centaines de boutons, ayant des papillons comme motif.  C\'est curieux, lorsque je retouche ces flammes volantes, je me rappelle leur velours transparent. ', 'madeleine7.jpg'),
(9, 'La particularité de cette madeleine est  qu\'elle condense l\'Histoire, celle qui a une grande hache et aussi les petites histoires.   Finalement, dans cette histoire, il n\'y a que l\'art et l\'analyse qui propose une solitude en couple. ', 'madeleine9.jpg'),
(10, 'C\'est en glanant les restes des pétards de la Saint Sylvestre, qu\'un premier janvier, moment propice pour les bonnes résolutions que j\'ai décidé de rompre le silence des madeleines pour leur offrir une nouvelle entrée et ainsi influencer leurs sorties.', 'madeleine10.jpg'),
(11, 'Du scotch-brite.  Un dimanche matin, alors que je ne m\'y attendais pas, cela m\'est arrivé.   Je faisais la vaisselle, cette petite chorégraphie qui crée le vide en vous, quand  brusquement le surplace s\'est éparpillé et l\'évaporation s\'est attardée. ', 'madeleine11.jpg'),
(12, 'Une madeleine coupante.  C\'est une boulle de noël ou plutôt c\'était une boule de noël, très frime.  D\'ailleurs elle a voulu trop frimer et elle s\'est cassée.  Moralité : Qui se donne de la prestance, manque de prestige. ', 'madeleine12.jpg'),
(13, 'Un reste a donné naissance à cette madeleine. Un reste de pigment, dit noir de vigne qui a séché sur ma palette.   Ce reste est resté vivre son présent dans une idée noire que j\'ai traduit ainsi.  J\'espère que je n\'aurai jamais à fuir, car la fuite est la neige éternelle de la honte. ', 'madeleine13.jpg'),
(14, 'En trouvant ce caillou, sur les berges de la Loue, je me suis souvenu de l\'origine de l\'hospitalité, qui serait de briser un caillou afin que chacun en garde la moitié comme la marque pérenne d\'un geste de partage.  A l\'évidence, la pluie du temps, a érodé tous les cailloux.  Il ne reste, que des grains de sable, miettes d\'un pain brisé dans la solitude. ', 'madeleine14.jpg'),
(15, 'Quelques cigares que j\'avais oubliés dans ma veste.  Evidement quand je les ai récupérés au fond de ma poche, ces micros architectures ne pouvaient plus se consumer à la vitesse de la marée. Leur seconde vie était trouvée. ', 'madeleine15.jpg'),
(16, 'Les paillettes, surtout quand elles sont argentées, nous cachent la difficulté d\'être durablement humain.            Cette curieuse pathologie et en plus sexuellement transmissible.', 'madeleine16.jpg'),
(17, 'C\'est pour voir le monde à l\'envers et m\'étonner de l\'habitude que j\'aie brisé cette monture de lunette et que j\'en aie fait un fagot de branche.   Finalement ces lunettes ont quitté leur serre à iris pour ne plus manger la fiction. ', 'madeleine17.jpg'),
(18, 'Un soir d\'automne, alors que je ramassais dans le jardin des graines d\'œillet d\'inde, soudainement, la lumière se mit à se déplacer, en même temps que mon regard et me pourchassa en reculant.  Cette absence d\'horizon, fonctionna en moi comme une absence de savoir.   Finalement est-ce que le fait de ne rien savoir pouvait me conduire jusqu\'à l\'infini ?  ', 'madeleine18.jpg'),
(7, 'C\'est en regardant le ressac des vagues, cet éternel retour, que je me suis aperçu que je n\'en finissais pas d\'ébaucher de vivre. Cette plage de sable, qui était devant moi, comme cette madeleine, est pour ainsi dire le seuil de ma sagesse qui est devenue une présence en évolution. ', 'madeleine8.jpg'),
(5, 'Petites piqûres de rappel.  Attention Hervé, avec toutes ces têtes colorées, tu vas finir par être l\'antiquaire de ton histoire. ', 'madeleine5.jpg'),
(6, 'Cette madeleine, comme toutes les autres d\'ailleurs, est devenue l\'odeur de ma mémoire.  Celle-ci a l\'odeur de l\'abeille. ', 'madeleine6.jpg'),
(3, 'Ce sont des ?taillures? de crayon.   En fait, quand j\'ai taillé mes crayons de couleurs, j\'ai éprouvé une curieuse impression, une impression de gratter le réel.  C\'est peut-être pour que j\'y découvre la totalité de la vie.', 'madeleine3.jpg'),
(4, 'C\'était un jeudi matin, je revenais de la boulangerie, mon pain complet sous le bras, quand une tuile tomba à mes pieds. Il y eu un minuscule nuage rouge qui me rappela à ma condition d\'homme. Moi aussi j\'étais un minuscule nuage de terre, continuant à mourir.  Mais heureusement l\'espoir me vint d\'un rayon de soleil matinal, me disant, que j\'étais aussi fait de lumière. Je ramassai donc mon petit nuage rouge, en pensant à la belle journée qui s\'annonçait.', 'madeleine4.jpg'),
(2, 'Quand j\'étais au cours préparatoire, j\'avais un cahier de texte emmailloté dans un protège-cahier orange. Le même orange que celui-ci.     Cette madeleine me renvoie cet écho orange lorsque ma mère me disait : “ Fais tes devoirs d\'abord, tu rigoleras après. ”   C\'est depuis ce jour que j\'ai décidé de rire pour gagner du temps. ', 'madeleine2.jpg'),
(1, 'Cette madeleine est faite avec une chaîne en plastique dorée, très kitch.  D\'ailleurs, elle était si laide, qu\'au moment où je l\'ai trouvé par terre, elle m\'a, pour ainsi dire, obligée à la ramasser.  Mais finalement, quand je l\'ai tenu au creux de ma main, je me suis demandé à quoi était enchaîné le premier anneau ? ', 'madeleine1.jpg');
