(1575, 'BATON MAGIQUE', 'La peinture phosphorescente capte \r\nla lumière et la restitue dans \r\nl’obscurité, d’où son étymologie : \r\nporteur de lumière. Au cours de ses \r\npromenades, le marcheur \r\nsélectionne par accident, selon les \r\nendroits où il se trouve, des bâtons \r\nde bois mort. .Le bâton, porteur du \r\npromeneur est recouvert d’une \r\npellicule phosphorescente. Cette \r\nnouvelle sève sensible à la lumière, \r\nemmagasine les images pendant \r\nque le baladeur enregistre les sons. \r\nC’est dans un fourreau, étanche à \r\nla lumière, que le bâton insolé est \r\ntransporté à l’atelier pour y être \r\nrecouvert d’une peinture de plomb. \r\nCette dernière inhibe les propriétés \r\ndu phosphore et conserve la \r\nmémoire de la promenade. \r\nExtrait du carnet : Fixer la mobilité ', '2017-03-07 15:11:02', 1),
