(5576, 'MANIE\r', ' Extrait d\'une liste non exhaustive,\r d\'une enquête menée par\r l\'hétéronyme Gesbor :\r Avant chaque repas, compter les\r dents du couteau.\r Retenir sa respiration avant de\r passer sous un pont.\r Marcher uniquement sur le joint\r des pavés.\r Compter les angles de la pièce où\r l\'on se trouve.\r Si l\'escalier possède un nombre\r impair de marches, en rajouter\r virtuellement une pour l\'équilibrer.\r Agencer les miettes de la table en\r jardin zen.\r Se peigner les cheveux avec un air\r dans la tête toujours différent.\r Faire claquer l\'ongle du pouce sur\r celui du majeur quand on dit\r « merde ».\r Regarder bouger ses doigts de\r pieds après avoir enlevé ses\r chaussures.\r Avant de se coucher, retourner une\r fois l\'oreiller et y enfoncer le poing.\r', '2017-04-20 10:32:50', 1),
