(7275, 'PRÉFACE\r', ' L\'encyclopédie \" Géographie d\'un multivers \" s\'adresse à tous.\r Chaque entrée n\'est pas suivie de la catégorie grammaticale, mais d\'une définition courte et pas toujours très claire.  Il n\'y a pas d\'exemples qui pourraient mettre en situation le mot dans une phrase complète.  Il n\'y a pas non plus de locutions et d\'expressions utilisant le mot.  Absence aussi de remarques concernant selon les cas la prononciation, l’orthographe, la grammaire ou l\'appartenance à une famille de mots.\r A chaque niveau d\'informations, cette encyclopédie ne vous propose pas un enrichissement du vocabulaire et une maîtrise plus étendue de la langue par des synonymes et contraires.  Aucune remarque complémentaire concernant l\'origine, l\'histoire ou l\'évolution de certains mots.\r Malgré toutes ces lacunes, \" Géographie d\'un multivers \" constitue un outil de la vie ayant pour ambition d\'offrir un fragment de la carte où figure le chemin du désir.\r', '2017-05-04 16:29:13', 1),
