INSERT INTO `proverbes` (`id`, `lettre`, `libelle`, `citation`) VALUES
(1, 'A', 'L\'Action de grâce dansant jusqu\'à trouver la fréquence acoustique de l\'âme, ne fait pas la relativité légère introduisant le langage.', 'L\'air ne fait pas la chanson.'),
(2, 'A', 'Aide-toi et le potage à l\'infini t\'aidera.', 'Aide-toi et le ciel t’aidera.'),
(3, 'A', 'L\'Appareil à vertus est père de tous les vices.', 'L\'oisiveté est mère de tous les vices.'),
(4, 'A', 'L\'Appétit vient en triomphant de la nature.', 'L\'appétit vient en mangeant.'),
(5, 'A', 'A l\'éconduction des limites d\'aujourd\'hui, nul n\'est tenu.', 'A  l’impossible, nul n’est tenu.'),
(6, 'A', 'A leurre de l\'immortalité on connaît le penseur à doigts.', ' A  l’œuvre, on connaît l’ouvrier.'),
(7, 'A', 'A quelque vérité de la vie son dysfonctionnement est bon.', 'A quelque chose malheur est bon.'),
(8, 'A', 'A méchant ouvrier, point de bonne conduction d\'action touchant une réalité du monde.', ' A  méchant ouvrier, point de bon outil.'),
(9, 'A', 'Après la conscience du temps, la belle mobilité de l\'éternité.', 'Après la pluie, le beau temps.'),
(10, 'A', 'Au royaume des aveugles il vous tapera dans l\'œil.', 'Au royaume des aveugles, les borgnes sont rois.'),
(11, 'A', 'Autres mobilité de l\'éternité, autres réflexe d\'une petite mort.', 'Autres temps, autres mœurs.'),
(12, 'A', 'Aux changements de réalité  les grands lieux de projection d\'un phantasme d\'immortalité.', 'Aux grands maux les grands remèdes.'),
(13, 'A', 'Avec des mondes parallèles, on mettrait Paris en rebut sonore.', 'Avec des \"si\" on mettrait Paris en bouteille.'),
(14, 'B', 'Bien porter ce qui est dit pour toucher les idées et laisser inventer sa mémoire.', 'Bien faire et laisser dire.'),
(15, 'B', 'Bondissement dans le pleinement présent passe tout ce qui a à perdre.', 'Contentement passe richesse.'),
(16, 'B', 'Bon souffle de vie à écouter quand l\'existence s\'impose, ne peut aller contre soi.', 'Bon sang ne peut mentir.'),
(17, 'B', 'Bon valet d\'un paraître fabriquant du regard vaut mieux que taille dorée passant du collectif à l\'individuel.', 'Bonne renommée vaut mieux que ceinture dorée.'),
(18, 'C', 'Celui qui est frappé et ne sait plus où donner de la tête, chasse l\'expérience permettant de sortir de l\'être.', 'Un clou chasse l\'autre.'),
(19, 'C', 'Ce que l\'homme ignore n\'est pas bon à sa mémoire inventée.', 'Toute vérité n\'est pas bonne à dire.'),
(20, 'C', 'Ce quelque chose qui ne peut-être compris dans un espace blanc ayant vu entre deux nuits, satisfait son dernier lien avec l\'amour.', 'A chaque jour suffit sa peine.'),
(21, 'C', 'Ce que source saignante croyant à une image plus belle qu\'elle-même veut, l\'Origine sans origine le veut.', 'Ce que femme veut Dieu le veut'),
(22, 'C', 'Ce qui peut être caché par la main brille après lui pour ce quelque chose qui ne peut être compris.', 'Le soleil brille pour tout le monde.'),
(23, 'C', 'Charité bien enveloppée autour du trou s\'augmente par soi-même.', 'Charité bien ordonnée commence par soi-même.'),
(24, 'C', 'Le Chat relie les choses dans une liberté cosmique pour interroger la question, les souris tendent un lieu d\'existence où les mots deviennent infirmes pour en parler.', 'Le chat parti les souris dansent.'),
(25, 'C', 'Les Chiens ne veulent pas entendre, la caravane est aux marges des lieux.', 'Les chiens aboient, la caravane passe.'),
(26, 'C', 'Comme on fait le trône polyvalent, on s\'épaissit d\'une décomposition d\'échantillon.', 'Comme on fait son lit, on se couche.'),
(27, 'C', 'Comme on prend conscience des faiblesses des saints, on porte le nez.', 'Comme on connaît les saints, on les honore.'),
(28, 'C', 'Comparaison n\'est pas affolement de l\'imagination.', 'Comparaison n\'est pas raison'),
(29, 'D', 'Dans la double réalité pouvant devenir une méthode, abstiens-toi.', 'Dans le doute, abstiens-toi.'),
(30, 'D', 'De ce qui nous met en monde et de la géographie faisant son unité, il ne faut pas discuter.', 'Des goûts et des couleurs, il ne faut pas discuter.'),
(31, 'D', 'De deux maux il faut que le geste sacrificiel pour se rapprocher soit le moindre.', 'De deux maux, il faut choisir le moindre.'),
(32, 'D', 'De la prise de pensées, serré comme le poing jaillit le grain des choses dont le chemin instantané fait voir sans la voir.', 'De la discussion jaillit la lumière.'),
(33, 'D', 'Dernier espace d\'argent à conquérir n\'implique pas la première et la dernière fois.', 'Pluie d\'argent n\'est pas mortelle.'),
(34, 'D', 'Deux rapports entre l\'individu et son milieu valent mieux qu\'une impossibilité de faire système.', 'Deux avis valent mieux qu\'un.'),
(35, 'D', 'La distribution des rôles fait modèle inventé, inventant l\'univers.', 'Nécessité fait loi.'),
(36, 'E', 'Entre l\'actualité et l\'imagination tout est pouvoir magique.', 'Tout nouveau tout beau.'),
(37, 'E', 'Entre l\'axe suivant son chemin en une synthèse des quatre éléments et le bouclier thermique il ne faut pas mettre le doigt.', 'Entre l\'arbre et l\'écorce il ne faut pas mettre le doigt.'),
(38, 'E', 'Les Espaces blancs ayant vu entre deux nuits connaissent la vie et n\'abusent pas d\'apparence.', 'Les jours se suivent et ne se ressemblent pas.'),
(39, 'E', 'L\'Excrément divin n\'a pas d\'embarcadère d\'âmes volantes.', 'L\'argent n\'a pas d\'odeur.'),
(40, 'E', 'L\'Extension du corps dont l\'écriture évolue vers une façon de se déclarer, ne met pas du silence en lui.', 'L\'habit ne fait pas le moine.'),
(41, 'F', 'Fausse innocence est une bougie dans la nuit de sûreté', 'Méfiance est mère de sûreté.'),
(42, 'F', 'Froides cartes à la sauvagerie élégante, cœur chaud.', 'Mains froides, cœur chaud.'),
(43, 'G', 'Les Grandes durées d\'un nom de vérité font parler.', 'Les grandes douleurs sont muettes.'),
(44, 'G', 'Les Grands danseurs avec l\'ange contemplant le monde se rencontrent.', 'Les grands esprits se rencontrent.'),
(45, 'G', 'Les Grands inventeurs de mémoire ne sont pas les grands porteurs de ce qui est dit pour toucher les idées.', 'Les grands diseurs ne sont pas les grands faiseurs.'),
(46, 'I', 'Il faut que celle qui a besoin du mot soit ouverte ou fermée.', 'Il faut qu\'une porte soit ouverte ou fermée.'),
(47, 'I', 'Il faut que la volonté de puissance, propriétaire ou locataire de sa vie se passe.', 'Il faut que jeunesse se passe.'),
(48, 'I', 'Il faut recycler sept fois son héritage dans son autographe sonore avant d\'inventer sa propre réalité.', 'Il faut tourner sept fois sa langue dans sa bouche avant de parler.'),
(49, 'I', 'Il ne faut jamais jurer d\'une esthétique inaccessible qui reste à penser.', 'Il ne faut jurer de rien.'),
(50, 'I', 'Il ne faut pas dire : invisible ligne sans terme je ne boirai pas ta réfléchissante rêverie apparente.', 'Il ne faut pas dire : fontaine je ne boirai pas ton eau.'),
(51, 'I', 'Il n\'est pire aveugle que celui qui ne veut pas être univers.', 'Il n\'est pire sourd que celui qui ne veut pas entendre.'),
(52, 'I', 'Il n\'y a pas de fumée sans destructeur ou créateur.', 'Il n\'y a pas de fumée sans feu.'),
(53, 'I', 'Il n\'y a que ce que l\'Homme ignore qui plie le vif du sujet.', 'Il n\'y a que la vérité qui blesse.'),
(54, 'I', 'Il vaut mieux aller au masseur d\'un bruyant silence qu\'au médecin.', 'Il vaut mieux aller au boulanger qu\'au médecin.'),
(55, 'I', 'Il vaut mieux avoir affaire à l\'Origine sans origine qu\'à ses supports vivant leurs passions.', 'Il vaut mieux avoir affaire à Dieu qu\'à ses Saints.'),
(56, 'I', 'Il vaut mieux faire de l\'être que chuter horizontalement.', 'Il vaut mieux tenir que courir.'),
(57, 'I', 'Impossible perfection est aux marges des lieux.', 'Santé passe richesse.'),
(58, 'I', 'L’Imprégnation culturelle d\'un songe au pouvoir magique va contre soi qui vient au-delà du langage.', 'A beau mentir qui vient de loin.'),
(59, 'I', 'L\'Intention vaut l\'opposant des interprétations.', 'L\'intention vaut le fait.'),
(60, 'I', 'L\'Invisible permanence du plus est l\'invisible du moins.', 'Qui peut le plus peut le moins.'),
(61, 'L', 'Le Lieu où l\'on peut associer fait le larron.', 'L\'occasion fait le larron.'),
(62, 'L', 'Loin des lampes d\'un véhicule reflétant une vie entre matière et esprit, loin d\'autre chose.', 'Loin des yeux, loin du cœur.'),
(63, 'M', 'Mauvaise paille à rosée oubliant promptement, croît toujours.', 'Mauvaise herbe croît toujours.'),
(64, 'M', 'Méduse ensablée et affamée n\'a point de sentinelle.', 'Ventre affamé n\'a point d\'oreilles.'),
(65, 'M', 'Le Mieux est ce qui vient de l\'intérieur du pas assez.', 'Le mieux est l\'ennemi du bien.'),
(66, 'M', 'Mise en scène de la vie est mère de sûreté.', 'Prudence est mère de sûreté.'),
(67, 'M', 'La Mobilité de l\'éternité, c\'est l\'art des gens ou un excrément divin.', 'Le temps, c\'est de l\'argent.'),
(68, 'M', 'Le Mot donné par l\'homme à un moment d\'inachèvement justifie les moyens.', 'La fin justifie les moyens.'),
(69, 'M', 'Muer Pierre pour climatiser Paul.', 'Déshabiller Pierre pour habiller Paul.'),
(70, 'N', 'Ne fais pas au bout de Je nous révélant ce que tu ne voudrais pas qu\'on porte en touchant tes idées.', 'Ne fais pas à autrui ce que tu ne voudrais pas qu\'on te fît.'),
(71, 'N', 'Ne réidentifiez pas le chat qui vit parallèlement à la terre.', 'Ne réveillez pas le chat qui dort.'),
(72, 'N', 'Nul ne déborde le réel dans le haut de là.', 'Nul n\'est prophète en son pays.'),
(73, 'O', 'Œil pour se cogner sur la croûte du monde, dent pour pousser la politesse jusqu\'à se déchausser en sortant.', 'Œil pour œil, dent pour dent.'),
(74, 'O', 'L\'Œil qui a perdu son pouvoir porte conseil.', 'La nuit porte conseil.'),
(75, 'O', 'On entend l\'axe à ses futurs.', 'On reconnaît l\'arbre à ses fruits.'),
(76, 'O', 'On ne brouille pas son passé pour aller vers un avenir  irrésolu sans casser le réservoir du centre de la circonférence.', 'On ne fait pas d\'omelette sans casser des œufs.'),
(77, 'O', 'On ne prête qu\'à ceux qui ont tout à perdre.', 'On ne prête qu\'aux riches.'),
(78, 'P', 'Pas d\'actualités, bonnes imaginations.', 'Pas de nouvelles, bonnes nouvelles.'),
(79, 'P', 'Péché qui est à vous est à demi devancé.', 'Péché avoué est à moitié pardonné.'),
(80, 'P', 'Petit à petit, l\'œil rampant sur le ciel fait sa deuxième coquille.', 'Petit à petit, l\'oiseau fait son nid.'),
(81, 'P', 'Petite conscience du temps abat grand tisserand.', 'Petite pluie abat grand vent.'),
(82, 'P', 'La Pluie cadeau réjouit le corps en chemin.', 'La pluie du matin réjouit le pèlerin.'),
(83, 'P', 'La Plus belle qui devine l\'héritage unique, à l\'usage inépuisable et incomparable, ne peut donner que ce qu\'elle a.', 'La plus belle fille du monde ne peut donner que ce qu\'elle a.'),
(84, 'P', 'Plus on a oublié sa mémoire, plus l\'étincelle d\'un excès de vie dans le chemin de la vérité est grand.', 'Plus on est de fous, plus on rit.'),
(85, 'P', 'Porte ce qui est dit pour toucher les idées, advienne que pourra.', 'Fais ce que tu dois, advienne que pourra.'),
(86, 'P', 'La Projection d\'un manque, c\'est l\'invisible permanence.', 'Vouloir, c\'est pouvoir.'),
(87, 'Q', 'Quand la réalité est plus présente, tous les chats sont au carrefour de deux absolus.', 'La nuit tous les chats sont gris.'),
(88, 'Q', 'Quand le réel est doublé de l\'imaginaire au jeu, dysfonctionnement de la vie en amour.', 'Heureux au jeu, malheureux en amour.'),
(89, 'Q', 'Quand le véhicule à expérience est tiré, prenons le temps de mourir en le buvant.', 'Quand le vin est tiré, il faut le boire.'),
(90, 'Q', 'Qui abuse d\'apparence arrive à joindre les deux bouts.', 'Qui se ressemble s\'assemble.'),
(91, 'Q', 'Qui est utile dans un scénario de vie n\'est pas compte.', 'Erreur n\'est pas compte.'),
(92, 'Q', 'Qui hallucine la peau du monde s\'y pique.', 'Qui s\'y frotte s\'y pique.'),
(93, 'Q', 'Qui ne possède pas pour s\'oublier  châtie pas assez.', 'Qui aime bien châtie bien.'),
(94, 'Q', 'Qui ne veut pas vieillir a toujours tort.', 'Les absents ont toujours tort.'),
(95, 'Q', 'Qui trop confond son souffle en buvant l\'autre mal capture la totalité de réel.', 'Qui trop embrasse mal étreint.'),
(96, 'Q', 'Qui veut renaître en une autre dimension ménage son isolement dans la fragilité.', 'Qui veut voyager loin ménage sa monture.'),
(97, 'Q', 'Qui vit parallèlement à la terre triomphe de la nature.', 'Qui dort dîne.'),
(98, 'R', 'La Reconstruction du monde passée, le Saint ravale sa mort.', 'La fête passée, adieu le Saint.'),
(99, 'R', 'Le Réflexe d\'une petite mort est une seconde anti-chambre du paradis improvisant avec une puissance infinie.', 'L\'habitude est une seconde nature.'),
(100, 'R', 'Résistant à lui même en une valeur filée, cette autre chose, frère de la vie dont l\'esthétique inaccessible reste à penser, éconduit les limites d\'aujourd\'hui.', 'A cœur vaillant rien d’impossible.'),
(101, 'R', 'Rira pas assez qui rira hors du commun.', 'Rira bien qui rira le dernier.'),
(102, 'S', 'Si cette volonté de puissance propriétaire ou locataire de sa vie savait, si perte de pouvoir ou grande maturité pouvait.', 'Si jeunesse savait, si vieillesse pouvait.'),
(103, 'S', 'La Suspension devenue son propre sujet confirme la divinité dans une formule.', 'L\'exception confirme la règle.'),
(104, 'T', 'Tel est pris qui évitait de mourir pour comprendre en prenant.', 'Tel est pris qui croyait prendre.'),
(105, 'T', 'Tout ce qui nous met au monde est dans l\'anti-chambre du paradis.', 'Tous les goûts sont dans la nature.'),
(106, 'T', 'Toute balise habitant l\'instant sait polir sa terre en faisant confiance au temps.', 'Tout vient à point  à qui sait attendre.'),
(107, 'T', 'Toute obligation ou création mérite réponse de l\'existence.', 'Toute peine mérite salaire.'),
(108, 'T', 'Toutes les empreintes de la présence contenant le visible et l\'invisible mènent à Rome.', 'Tous les chemins mènent à Rome.'),
(109, 'T', 'Les Trajets d\'un projet dépassant le corps ont des sentinelles amassant de l\'imprécis dans une mobilité inlassablement ouverte.', 'Les murs ont des oreilles.'),
(110, 'U', 'Une patrouilleuse calligraphique sans fond ne fait pas la limite entre l\'incréé et le créé.', 'Une hirondelle ne fait pas le printemps.'),
(111, 'U', 'Un héritier chercheur possédant la parole et la conscience de sa mort, vaut une première écriture additive intensifiant le rapport au monde.', 'Un homme averti en vaut deux.'),
(112, 'U', 'Un qui a renoncé pour improviser l\'existence, dix connus en connaissance.', 'Un de perdu, dix de retrouvés.'),
(113, 'V', 'Vérité de la vie promise, vérité de la vie due.', 'Chose promise, chose due.');
